import {LoginPage,SignUppage} from "./pages/portal/authenticate"


function App() {
  return(
    <div className="App">

	    <Header/>
      <Route exact Link="http://localhost:3000/" component={HomePage}></Route>
      <Route exact Link="http://localhost:3000/formation" component={FormationPage}></Route>
    </div>
  ) 
}

export default App;
